//====================================================================
//! \brief  Holding the OnnxRuntime Neural Net parser and execution engine
class OnnxRuntimeEngine : public InferenceEngines
{
private:
    OrtEnv*                         m_opEnviroment;
    OrtSessionOptions*              m_opSessionOptions;
    OrtSession*                     m_opSession;
    OrtStatus*                      m_opStatus;
    OrtAllocator*                   m_opAllocator;
    std::vector<const char*>        m_vcInputNodeNames;
