    std::vector<uint8_t>            m_vuInputTensorValues;
    mutable OrtValue*               m_opInputTensor;
    mutable OrtValue*               m_opOutputTensor;
    mutable std::vector<uint8_t>    m_vuClasOutData;

public:
    //! \brief  Constructor for onnxruntime inference engine
    //!         The class holds the onnx model parser and the created model.
    //!         The contructor parse the network and optimize it to the specified backend. Then
    //!         the network will load to the runtime and memory will be allocated for the tensors.
    //!
    //! \param [in] sModelPath           The path to the onnx model.
    //! \param [in] uModelType           Type of the model in the model path
    //! \param [in] stModelOutputConf     Output (tensor) informations for the model
    OnnxRuntimeEngine(const std::string &sModelPath,
                      const uint8_t &uModelType,
                      const tModelOutput &stModelOutputConf);

    //! \brief  Destructor
    virtual ~OnnxRuntimeEngine();

    //! \brief  Execute one inference for the model
    //!
    //! \param [in] inputData   The input data for the neural net
    void run(const void *inputData);

    void checkStatus(OrtStatus *status);
};

#endif // ONNXRUNTIMEENGINE_H`

`#include "OnnxRuntimeEngine.h"

//******************************************************************************
//                      Class Implementation OnnxRuntimeEngine
//******************************************************************************

const OrtApi* oAPI = OrtGetApiBase()->GetApi(ORT_API_VERSION);

//====================================================================
//  Constructor
OnnxRuntimeEngine::OnnxRuntimeEngine(const std::string &sModelPath,
                                     const uint8_t &uModelType,
                                     const tModelOutput &stModelOutputConf) :
    InferenceEngines(uModelType),
    m_opInputTensor(nullptr),
    m_opOutputTensor(nullptr)
{
    checkStatus(oAPI->CreateEnv(ORT_LOGGING_LEVEL_VERBOSE,
                                "neuralImageProcessor",
                                &m_opEnviroment));
    checkStatus(oAPI->CreateSessionOptions(&m_opSessionOptions));
    checkStatus(oAPI->SetSessionGraphOptimizationLevel(m_opSessionOptions,
                                                       ORT_ENABLE_BASIC));
    checkStatus(OrtSessionOptionsAppendExecutionProvider_VsiNpu(m_opSessionOptions, 0));
    checkStatus(oAPI->CreateSession(m_opEnviroment,
                                    (sModelPath + ".onnx").c_str(),
                                    m_opSessionOptions,
                                    &m_opSession));
    checkStatus(oAPI->GetAllocatorWithDefaultOptions(&m_opAllocator));
    size_t numInputNodes;
    m_opStatus = oAPI->SessionGetInputCount(m_opSession, &numInputNodes);
    m_vcInputNodeNames = std::vector<const char*>(numInputNodes);
    printf("Number of inputs = %zu\n", numInputNodes);

    for(size_t i = 0; i < numInputNodes; i++) {
        char* inputName;
        m_opStatus = oAPI->SessionGetInputName(m_opSession, i, m_opAllocator, &inputName);
        printf("Input %zu : name=%s\n", i, inputName);
        m_vcInputNodeNames[i] = inputName;

        OrtTypeInfo *typeInfo;
        m_opStatus = oAPI->SessionGetInputTypeInfo(m_opSession, i, &typeInfo);
        const OrtTensorTypeAndShapeInfo* tensor_info;
        checkStatus(oAPI->CastTypeInfoToTensorInfo(typeInfo, &tensor_info));
        ONNXTensorElementDataType type;
        checkStatus(oAPI->GetTensorElementType(tensor_info, &type));
        printf("Input %zu : type=%d\n", i, type);

        size_t num_dims;
        checkStatus(oAPI->GetDimensionsCount(tensor_info, &num_dims));
        printf("Input %zu : num_dims=%zu\n", i, num_dims);
        m_viInputNodeDims.resize(num_dims);
        oAPI->GetDimensions(tensor_info, (int64_t*)m_viInputNodeDims.data(), num_dims);
        for (size_t j = 0; j < num_dims; j++)
          printf("Input %zu : dim %zu=%jd\n", i, j, m_viInputNodeDims[j]);

        oAPI->ReleaseTypeInfo(typeInfo);
    }

    m_vuInputTensorValues = std::vector<uint8_t>(224 * 224 * 3);
    m_vuClasOutData = std::vector<uint8_t>(stModelOutputConf.wDim0Size *
                                           stModelOutputConf.wDim1Size);
    m_vcOutputNodeNames = {"MobilenetV1/Predictions/Reshape_1"};

    checkStatus(oAPI->CreateCpuMemoryInfo(OrtArenaAllocator, OrtMemTypeDefault, &m_opMemoryInfo));
}

//====================================================================
//  Destructor
OnnxRuntimeEngine::~OnnxRuntimeEngine()
{
    oAPI->ReleaseValue(m_opOutputTensor);
    oAPI->ReleaseValue(m_opInputTensor);
    oAPI->ReleaseSession(m_opSession);
    oAPI->ReleaseSessionOptions(m_opSessionOptions);
    oAPI->ReleaseEnv(m_opEnviroment);
}

//====================================================================
// helper function to check for status
void OnnxRuntimeEngine::checkStatus(OrtStatus* status)
{
    if (status != NULL) {
      const char* msg = oAPI->GetErrorMessage(status);
      fprintf(stderr, "%s\n", msg);
      oAPI->ReleaseStatus(status);
      exit(1);
    }
}

//====================================================================
//  run a inference on the neural network
void OnnxRuntimeEngine::run(const void *inputData)
{
    if(m_uModelType == 1) {

    }
    else {
        checkStatus(oAPI->CreateTensorWithDataAsOrtValue(m_opMemoryInfo,
                                             (uint8_t*)inputData,
                                             224 * 244 * 3 * sizeof(uint8_t),
                                             m_viInputNodeDims.data(),
                                             4,
                                             ONNX_TENSOR_ELEMENT_DATA_TYPE_UINT8,
                                             &m_opInputTensor));
        std::vector<int64_t> a = {1, 1001};
        checkStatus(oAPI->CreateTensorWithDataAsOrtValue(m_opMemoryInfo,
                                             (uint8_t*)m_vuClasOutData.data(),
                                             1001 * sizeof(uint8_t),
                                             a.data(),
                                             2,
                                             ONNX_TENSOR_ELEMENT_DATA_TYPE_UINT8,
                                             &m_opOutputTensor));
        int isTensor;
        checkStatus(oAPI->IsTensor(m_opInputTensor, &isTensor));
        checkStatus(oAPI->Run(m_opSession,
                              nullptr,
                              m_vcInputNodeNames.data(),
                              (const OrtValue* const*)&m_opInputTensor,
                              1,
                              m_vcOutputNodeNames.data(),
                              1,
                              &m_opOutputTensor));
    }
}`
